          Products p ON p.ProductID = o.ProductID INNER JOIN Categories c ON
          c.CategoryID = p.CategoryID WHERE (o1.ShippedDate BETWEEN :from AND
          :to AND o.UnitPrice > :minValue) ORDER BY [category], [product] ;
